import styles from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton.js";
import meal from "./meal.jpg";
let Header = () => {
  return (
    <div>
      <div className={styles.header}>
        <h2>React Meals</h2>
        <HeaderCartButton />
      </div>
      <div className={styles["main-image"]}>
        <meal></meal>>
      </div>
    </div>
  );
};
export default Header;
